import React from "react";

const SnakeBody = props => {
  return (
    <div>
      {props.snakeDots.map((dot, i) => {
        const style = {
          left: `${dot[0] * 20}px`,
          top: `${dot[1] * 20}px`
        };
        return <div className="snake-dot" key={i} style={style}></div>;
      })}
    </div>
  );
};

export default SnakeBody;
